[recommended_target_hash]
k: (#execute => #end) ~> _
output: _ => #asByteStackInWidth(#blockhash(BLOCK_HASHES, #expectedBlockNumber(CUR_EPOCH, EPOCH_LEN), BLOCK_NUM -Int 1, 0), 32)
memoryUsed: 0 => _
callDepth: CD
callStack: _
callData: #abiCallData("recommended_target_hash", .TypedArgs)
wordStack: .WordStack => _
localMem: .Map => _
pc: 0 => _
gas: GCAP => GCAP -Int 893
log: _
refund: _
storage:
    (#hashedLocation({COMPILER}, {EPOCH_LENGTH}, .IntList) |-> EPOCH_LEN)
    (#hashedLocation({COMPILER}, {CURRENT_EPOCH}, .IntList) |-> CUR_EPOCH)
    _:Map
requires:
    andBool 0 <=Int EPOCH_LEN andBool EPOCH_LEN <=Int maxInt128
    andBool 0 <=Int CUR_EPOCH andBool CUR_EPOCH <=Int maxInt128
    andBool 1 <=Int (CUR_EPOCH *Int EPOCH_LEN)
    andBool (CUR_EPOCH *Int EPOCH_LEN) <=Int maxInt128
    andBool BLOCK_NUM -Int 256 <=Int #expectedBlockNumber(CUR_EPOCH, EPOCH_LEN)
    andBool #expectedBlockNumber(CUR_EPOCH, EPOCH_LEN) <Int BLOCK_NUM
    andBool 0 <=Int CD andBool CD <Int 1024
    andBool GCAP >=Int 893
ensures:
attribute: [trusted]

[vote]
k: #execute => (STOP ~> _)
output: _
memoryUsed: 0 => _
callDepth: 0
callStack: _
calldata: #abiCallData("vote", #int128(VINDEX), #bytes32(T_HASH), #int128(T_EPOCH), #int128(S_EPOCH))
wordStack: .WordStack => _
localMem: .Map => ( .Map[ RET_ADDR := #asByteStackInWidth(1, 32) ] _:Map )
pc: 0 => _
gas: 10000000 => _
log: _
refund: _ => _
storage:
    (#hashedLocation({COMPILER}, {VALIDATORS}, VINDEX {DEPOSIT}) |-> VDEPOSIT)
    (#hashedLocation({COMPILER}, {VALIDATORS}, VINDEX {END_DYNASTY}) |-> END_DYN)
    (#hashedLocation({COMPILER}, {VALIDATORS}, VINDEX {START_DYNASTY}) |-> START_DYN)
    (#hashedLocation({COMPILER}, {DYNASTY_IN_EPOCH}, T_EPOCH) |-> CUR_DYN)
    (#hashedLocation({COMPILER}, {VOTES}, T_EPOCH {VOTE_BITMAP} T_HASH VIDKEY) |-> (VOTE_VECTOR => #setVoteBit(VOTE_VECTOR, VINDEX)))
    (#hashedLocation({COMPILER}, {VOTES}, S_EPOCH {IS_JUSTIFIED}) |-> IS_SOURCE_JUSTIFIED)
    (#hashedLocation({COMPILER}, {VOTES}, T_EPOCH {CUR_DYN_VOTES} S_EPOCH) |-> CUR_DYN_VOTES)
    (#hashedLocation({COMPILER}, {VOTES}, T_EPOCH {PREV_DYN_VOTES} S_EPOCH) |-> PREV_DYN_VOTES)
    (#hashedLocation({COMPILER}, {EPOCH_LENGTH}, .IntList) |-> EPOCH_LEN)
    (#hashedLocation({COMPILER}, {CURRENT_EPOCH}, .IntList) |-> CUR_EPOCH)
    _:Map
requires:
    // Type constraint
    andBool 0  <Int VINDEX      andBool VINDEX  <=Int maxInt128
    andBool 0 <=Int T_HASH      andBool T_HASH  <Int pow256
    andBool 0 <=Int T_EPOCH     andBool T_EPOCH <=Int maxInt128
    andBool 0 <=Int S_EPOCH     andBool S_EPOCH <=Int maxInt128
    andBool 0 <=Int VDEPOSIT    andBool VDEPOSIT  <=Int maxDecimal
    andBool 0 <=Int END_DYN     andBool END_DYN   <=Int maxInt128
    andBool 0 <=Int START_DYN   andBool START_DYN <=Int maxInt128
    andBool 0 <=Int CUR_DYN     andBool CUR_DYN   <=Int maxInt128
    andBool 0 <=Int VOTE_VECTOR andBool VOTE_VECTOR <Int pow256
    andBool 0 <=Int CUR_DYN_VOTES  andBool CUR_DYN_VOTES  <=Int maxDecimal
    andBool 0 <=Int PREV_DYN_VOTES andBool PREV_DYN_VOTES <=Int maxDecimal
    andBool 0 <Int EPOCH_LEN    andBool EPOCH_LEN <=Int maxInt128
    andBool 0 <Int CUR_EPOCH    andBool CUR_EPOCH <=Int maxInt128
    andBool VIDKEY ==Int VINDEX /Int 256
    // FIXME
    andBool 0 <Int VINDEX modInt 256
    // Avoid Overflow
    andBool 1 <=Int (CUR_EPOCH *Int EPOCH_LEN)
    andBool (CUR_EPOCH *Int EPOCH_LEN) <=Int maxInt128
    andBool (CUR_DYN_VOTES +Int VDEPOSIT) <= maxDecimal
    // Path constraint
    andBool BLOCK_NUM -Int 256 <=Int #expectedBlockNumber(CUR_EPOCH, EPOCH_LEN)
    andBool #expectedBlockNumber(CUR_EPOCH, EPOCH_LEN) <Int BLOCK_NUM
    andBool #notVoteBefore(VOTE_VECTOR, VINDEX)
    andBool T_HASH ==Int #recommendedBlockHash(BLOCK_HASHES, BLOCK_NUM, CUR_EPOCH, EPOCH_LEN)
    andBool T_EPOCH ==Int CUR_EPOCH
    andBool IS_SOURCE_JUSTIFIED ==Int 1
    andBool #inCurDynasty(START_DYN, END_DYN, CUR_DYN)
    andBool #inPrevDynasty(START_DYN, END_DYN, CUR_DYN)
ensures:
attribute:

[pgm]
compiler: "Vyper"
; self.validators
validators: 0
deposit: 1
end_dynasty: 2
start_dynasty: 3
; self.dynasty_in_epoch
dynasty_in_epoch: 10
; self.votes
votes: 11
cur_dyn_votes: 0
is_justified: 2
prev_dyn_votes: 3
vote_bitmap: 4
; self.epoch_length
epoch_length: 16
; self.current_epoch
current_epoch: 18
code: ""
